ཱཱིཻུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪྦྷྦྷཱཱཱིིུྦྷྪྦྷཻཹཱཱིུླཱཱཱྀིཻུུླྀཷཱཱཱཱཱཱཱིཻིིིུུུྦྷྪ